var ReportPageControl = function(){};

ReportPageControl.prototype.handle = function(headNode, bodyNode, cb)
{
    console.log(bodyNode);
    var self = this;
    var cmd = headNode.cmd;
    self[cmd[1]](headNode, bodyNode, cb);
};

ReportPageControl.prototype.bank = function(headNode, bodyNode, cb)
{
    var self = this;
    cb(null, {});
}

ReportPageControl.prototype.list = function(headNode, bodyNode, cb)
{
    var self = this;
    var backBodyNode={};
    backBodyNode.rst = {};
    backBodyNode.count = 0;
    backBodyNode.skip = 0;
    backBodyNode.limit = 5;
    cb(null, backBodyNode);
}

module.exports = new ReportPageControl();